import React, {Component} from 'react';
import '../../App.css';
//import axios from 'axios';
//import cookie from 'react-cookies';
//import {Redirect} from 'react-router';

class BuyerSignup extends Component {


    render(){

        return(
            <div>
                <div class="container">
                <div class="login-form">
                    <div class="main-div">
                        <div class="panel">
                            <h2>Create your account</h2>
                        </div>

                            <div class="form-group">
                                <div className="col-md-12">
                                    <span className="col-md-3">First Name:</span>
                                    <span className="col-md-3"></span>
                                    <span className="col-md-3">Last Name:</span>

                                </div>
                                <div>
                                <div className="col-md-6"><input type="text" class="form-control" name="firstname" required/></div>
                                <div className="col-md-6"><input type="text" class="form-control" name="lastname" required/></div>
                                </div>
                            </div>
                            <div class="form-group">
                                Email<br/>
                                <input type="email" class="form-control" name="email" required />
                            </div>
                            <div class="form-group">
                                Password (8 charactar minimum)<br/>
                                <input type="password" class="form-control" name="password" required />
                            </div>
                            <button class="btn btn-primary">Create your account</button>                 
                    </div>
                </div>
            </div>
            </div>
        )
    }
}

export default BuyerSignup;
